import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

import MuiDrawer from "@mui/material/Drawer";

import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";

import Appbars from "./components/appbars.js";
import Searchbox from "./components/searchbox.js";
import Musiccontroller from "./components/musiccontroller.js";
import Feedswrap from "./components/feedswrap.js";
import { mainListItems, secondaryListItems } from "./components/sidebars";

import Login from "./route/login.js";
import Register from "./route/register.js";

const Drawer = styled(MuiDrawer, {
  shouldForwardProp: (prop) => prop !== "open",
})(({ theme, open }) => ({
  "& .MuiDrawer-paper": {
    position: "relative",
    whiteSpace: "nowrap",
    width: drawerWidth,
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
    boxSizing: "border-box",
    ...(!open && {
      overflowX: "hidden",
      transition: theme.transitions.create("width", {
        easing: theme.transitions.easing.sharp,
        duration: theme.transitions.duration.leavingScreen,
      }),
      width: theme.spacing(7),
      [theme.breakpoints.up("sm")]: {
        width: theme.spacing(9),
      },
    }),
  },
}));

let CenterBox = styled.div`
  text-align: center;
`;

let MainWrap = styled.div`
  // max-width: 1300px;
  margin: auto;
  background: #00457e;
  padding: 1rem;
`;

let LoginBtn = styled.button`
  text-align: center;
  color: white;
  border-radius: 1rem;
  padding: 0.8rem;
  background: #2f70af;
  float: left;
  font-size: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
  border: none;
`;

let PlayerBox = styled.div`
  border-radius: 1rem;
  background: #b9848c;
  color: white;
  padding: 0.5rem;
  margin-top: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

let LoginBox = styled.div`
  background: #02315e;
  border-radius: 1rem;
  padding: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
  float: right;
  color: white;
  margin-top: 1rem;
`;
let InputBox = styled.div`
  background: white;
  color: black;
  margin: 0.2rem;
  width: 10rem;
`;

function App() {
  return (
    <>
      <Appbars></Appbars>
      <mainListItems></mainListItems>
      <MainWrap className="App">
        <CenterBox>
          <Searchbox></Searchbox>
        </CenterBox>
        <Feedswrap></Feedswrap>

        <PlayerBox>
          <Musiccontroller></Musiccontroller>
        </PlayerBox>
      </MainWrap>
      <Login></Login>
      <Register></Register>
    </>
  );
}

export default App;
